  return (
    <div className="profile bg-light">
      <img src={avatar} alt="" className="round-mg"/>
      <div className="">
        <h2>{name}</h2>
  <p>{status}{company &&<span>at</span>}</p>
      </div>
    </div>
  )
}

ProfileItem.propTypes = {
  profile: PropTypes.object.isRequired,
}

export default ProfileItem
